import React from "react";
import "./UserList.css";

const UserList = (props) => {
  const itemUser = props.items.map((item) => {
    item.userName, item.age;
  });
  return (
    <div className="list-controler">{props.userName + " " + props.age}</div>
  );
};

export default UserList;
